  `lng` varchar(20) NOT NULL DEFAULT '' COMMENT '经度',
  `pj_fen` int(10) NOT NULL DEFAULT '0' COMMENT '评价分数',
  `pj_num` int(10) NOT NULL DEFAULT '0' COMMENT '评价次数',
  `is_top` int(1) NOT NULL DEFAULT '0' COMMENT '0 不推荐 1推荐',
  `pay_code` varchar(255) NOT NULL DEFAULT '' COMMENT '收款码',
  `open` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1开启 0关闭',
  `last_ip` varchar(50) NOT NULL DEFAULT '' COMMENT '登录ip',
  `pt_rate` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '平台折扣\r\n',
  `store_rate` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '店铺折扣',
  `sort` int(10) NOT NULL DEFAULT '20' COMMENT '排序',
  `song` int(1) NOT NULL DEFAULT '0' COMMENT '外送',
  `ada` int(1) NOT NULL DEFAULT '0' COMMENT '汇付通道开通  1已开通 0未开通',
  `work_time` varchar(255) DEFAULT NULL COMMENT '营业时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='商户表';

