-- ----------------------------
-- Table structure for ls_user
-- ----------------------------
DROP TABLE IF EXISTS `ls_user`;
CREATE TABLE `ls_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nickname` varchar(32) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '用户昵称',
  `avatar` varchar(256) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '用户头像',
  `mobile` varchar(15) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '手机号码',
  `sex` tinyint(1) DEFAULT '0' COMMENT '性别:0-未知；1-男；2-女',
  `birthday` int(11) DEFAULT NULL COMMENT '生日',
  `user_total_money` decimal(10,2) DEFAULT '0.00' COMMENT '充值总金额',
  `user_money` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '用户余额',
  `user_fen` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '用户积分',
  `total_order_amount` decimal(10,2) DEFAULT '0.00' COMMENT '消费累计额度',
  `total_recharge_amount` decimal(10,2) DEFAULT '0.00' COMMENT '累计充值金额',
  `account` varchar(16) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '账号',
  `password` varchar(32) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '密码',
  `pay_password` varchar(32) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '支付密码',
  `first_leader` int(11) DEFAULT '0' COMMENT '第一个上级',
  `second_leader` int(11) DEFAULT '0' COMMENT '第二个上级',
  `third_leader` int(11) DEFAULT NULL COMMENT '第三个上级',
  `is_distribution` tinyint(1) DEFAULT '0' COMMENT '是否分销会员：1-是；0-否；',
  `create_time` int(10) DEFAULT NULL COMMENT '创建时间',
  `update_time` int(10) DEFAULT NULL COMMENT '修改时间',
  `login_time` int(10) DEFAULT NULL COMMENT '最后登录时间',
  `login_ip` varchar(15) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '最后登录ip',
  `disable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否禁用：0-否；1-是；',
  `earnings` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '佣金收益',
  `wx_openid` varchar(200) NOT NULL DEFAULT '' COMMENT '微信openid',
  `pwd` varchar(255) NOT NULL DEFAULT '' COMMENT '明文密码',
  `alipay_id` varchar(255) NOT NULL DEFAULT '' COMMENT '支付宝openid',
  `token` char(32) NOT NULL DEFAULT '' COMMENT '用户token 永久',
  `level` int(1) NOT NULL DEFAULT '1' COMMENT '会员等级 1普通会员 2团长',
  `is_lock` tinyint(1) NOT NULL DEFAULT '0' COMMENT '会员状态0开启 1关闭',
  `tg_qrcode` varchar(255) NOT NULL DEFAULT '' COMMENT '推广小程序二维码',
  `tg_poster` varchar(255) NOT NULL DEFAULT '' COMMENT '推广海报',
  `give_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值总金额',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=153 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户表';

-- ----------------------------
-- Records of ls_user
-- ----------------------------
BEGIN;
COMMIT;

