INSERT INTO `ls_company` (`id`, `store_name`, `address`, `lat`, `lng`, `content`) VALUES (1, '美车之家', '临沂市兰山区兰陵路9号大剧院地下车库西北角4号门', '35.093036', '118.355432', '<p>美车之家科技服务(临沂)有限公司</p><p><br></p><p>美车之家，中国汽车服务创新者——</p><p>自2021年成立以来，秉承“美车之家”的企业愿景，坚守“让您的门店更赚钱”的使命，率先突破行业现状。</p><p>短短一年内，已拥有全城数家门店。以大数据为依托，对汽车洗美行业门店进行转型升级、管理培训、技术支持、人员输送、源头产品采购等标准化建设，开拓汽车服务后市场新纪元。</p><p>未来，每车之家将以科技发展为核心，完善前后端联动的运营体系，实现综合性盈利。</p><p><img src=\"http://mczj.xinmke.com/uploads/20211227/997a1727fb9c8fecf353d7e577c2f06d.jpeg\" alt=\"图片\"><br></p>');
